import React from "react";

const Pokedex = (props) => {
    console.log(props);

  return (
    <div>
      <div className="header">
        <h1>Pokedex </h1>
        <div>Pagination</div>
        <div className="pokedex-grid">
          <div>1</div>
          <div>2</div>
          <div>3</div>
          <div>4</div>
          <div>5</div>
          <div>6</div>
          <div>7</div>
          <div>8</div>
          <div>9</div>
        </div>
      </div>
    </div>
  );
};

export default Pokedex;
